import React, { useState } from 'react';
import { View, Text, TouchableOpacity, Image, Modal, StyleSheet } from 'react-native';
import { FontAwesome } from '@expo/vector-icons';

const Students = ({ navigation }) => {
  const [isDenunciasModalVisible, setDenunciasModalVisible] = useState(false);

  const toggleDenunciasModal = () => {
    setDenunciasModalVisible(!isDenunciasModalVisible);
  };

  return (
    <View style={styles.container}>
      <Image
        source={require('../images/municipioqueretaro.png')}
        style={styles.image}
      />
      <Text style={styles.title}>Bienvenido a la página para estudiantes</Text>

      {/* Botón de Denuncias */}
      <TouchableOpacity style={styles.button} onPress={toggleDenunciasModal}>
        <FontAwesome name="exclamation-triangle" size={30} color="white" />
        <Text style={styles.buttonText}>Denuncias</Text>
      </TouchableOpacity>

      {/* Modal de Denuncias */}
      <Modal
        animationType="slide"
        transparent={true}
        visible={isDenunciasModalVisible}
        onRequestClose={toggleDenunciasModal}
      >
        <View style={styles.modalContainer}>
          <View style={styles.modalContent}>
            <Text style={styles.modalTitle}>Categorías de Denuncias</Text>
            <TouchableOpacity onPress={() => alert('Denuncias Penales')}>
              <Text style={styles.modalItem}>Denuncias Penales: Relacionadas con actividades delictivas. Pueden incluir delitos como robo, fraude, agresión, etc.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias Civiles')}>
              <Text style={styles.modalItem}>Denuncias Civiles: Se presentan en casos de disputas entre individuos, como casos de negligencia, disputas contractuales, daños y perjuicios, entre otros.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias Laborales')}>
              <Text style={styles.modalItem}>Denuncias Laborales: Relativas a cuestiones en el lugar de trabajo, como acoso laboral, discriminación, violaciones de derechos laborales, etc.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Abuso Infantil')}>
              <Text style={styles.modalItem}>Denuncias de Abuso Infantil: Cuando se sospecha o se tiene conocimiento de maltrato o abuso hacia un menor.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Violencia Doméstica')}>
              <Text style={styles.modalItem}>Denuncias de Violencia Doméstica: Para reportar casos de violencia física, emocional o psicológica dentro del ámbito doméstico.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias Medioambientales')}>
              <Text style={styles.modalItem}>Denuncias Medioambientales: Relativas a actividades que dañan el medio ambiente, como vertidos contaminantes, deforestación ilegal, etc.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Corrupción')}>
              <Text style={styles.modalItem}>Denuncias de Corrupción: Para informar sobre prácticas corruptas en instituciones gubernamentales, empresas u otras organizaciones.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Acoso Sexual')}>
              <Text style={styles.modalItem}>Denuncias de Acoso Sexual: Para reportar casos de acoso sexual en el lugar de trabajo u otros entornos.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Derechos Humanos')}>
              <Text style={styles.modalItem}>Denuncias de Derechos Humanos: Se utilizan para informar sobre violaciones de los derechos fundamentales de las personas.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Fraude')}>
              <Text style={styles.modalItem}>Denuncias de Fraude: Relativas a engaños financieros, estafas, o cualquier actividad ilegal que implique manipulación económica.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Salud Pública')}>
              <Text style={styles.modalItem}>Denuncias de Salud Pública: Para informar sobre situaciones que representan un riesgo para la salud de la comunidad, como brotes de enfermedades contagiosas.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={() => alert('Denuncias de Tráfico de Drogas')}>
              <Text style={styles.modalItem}>Denuncias de Tráfico de Drogas: Relativas a actividades ilegales relacionadas con drogas y estupefacientes.</Text>
            </TouchableOpacity>
            <TouchableOpacity onPress={toggleDenunciasModal}>
              <Text style={styles.closeButton}>Cerrar</Text>
            </TouchableOpacity>
          </View>
        </View>
      </Modal>

      <TouchableOpacity onPress={() => alert('Reporte')} style={styles.reportButton}>
        <FontAwesome name="bar-chart" size={30} color="white" />
        <Text style={styles.buttonText}>Reporte</Text>
      </TouchableOpacity>

      <TouchableOpacity
        style={styles.button}
        onPress={() => alert('Implementa la lógica de cierre de sesión')}
      >
        <FontAwesome name="sign-out" size={30} color="white" />
        <Text style={styles.buttonText}>Cerrar Sesión</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    paddingHorizontal: 20,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  image: {
    width: 200,
    height: 200,
    resizeMode: 'contain',
    marginBottom: 20,
  },
  button: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: '#0073e6',
    padding: 10,
    borderRadius: 10,
    marginBottom: 10,
  },
  reportButton: {
    flexDirection: 'row',
    alignItems: 'center',
    backgroundColor: '#34A853', // Color verde para el botón de Reporte
    padding: 10,
    borderRadius: 10,
    marginBottom: 10,
  },
  buttonText: {
    color: 'white',
    fontSize: 20,
    marginLeft: 10,
  },
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
  },
  modalContent: {
    backgroundColor: 'white',
    padding: 20,
    borderRadius: 10,
    width: '80%',
  },
  modalTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  modalItem: {
    fontSize: 16,
    marginBottom: 10,
  },
  closeButton: {
    fontSize: 18,
    color: 'blue',
    textAlign: 'center',
    marginTop: 20,
  },
});

export default Students;
